import {request} from "./request";

export function insertUser(data) {
    return request({
        url:'/saler/user/insertUser',
        method:'post',
        headers: {'content-type': 'multipart/form-data'},
        data
    })
}

export function getUser(page) {
    return request({
        url: `/saler/user/${page}`,
        method: 'get',
    })
}

export function deleteUserById(id) {
    return request({
        url:`/saler/user/${id}`,
        method:'delete',
    })
}
